import React from "react";
import { Link } from "react-router-dom";

const Dashboard = () => {
  return (
    <div>
      <h1>Dashboard Page</h1>
      <Link to="/create-profile" className="btn btn-primary">
        Create Profile
      </Link>
      <Link to="/add-education" className="btn btn-primary">
        Add Education
      </Link>
    </div>
  );
};

export default Dashboard;
